from collections import defaultdict
from typing import List


class Solution:
    def findSubstring(self, s: str, words: List[str]) -> List[int]:
        # Hmm. Basically just sliding window, right?

        if not words:
            return []


        n = len(s)
        n2 = len(words)
        w = len(words[0])
        indices = []


        # We're guaranteed the length of each word in words is the same
        # So I guess we can do some checks here?
        if len(set(words)) == 1 and n2 < n:
            for i in range(n - n2 * w):
                indices.append(i)
        else:
            # Do we generate all permutations???
            # No...seems way too complex...?
            # Maybe we have a hash table corresponding to each word
            # and for each word we store an array of indices where the word
            # appears. Then at the end loop through and check for all the
            # possible permutations...?
            # Fuck
            map = defaultdict(list)
            for i in range(n):
                for word in words:
                    if s[i:i + w] == word:
                        map[word].append(i)
            
            print(map)
            # Ok after building this check for substrings???
            # UGH

        return indices


